import React, { Component } from 'react';
import Counter from './components/counter/Counter'
import TodoApp from './components/todo/TodoApp'
//import './App.css';
//import './bootstrap.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <HeaderWall />
        <SideNavBar />
        <ActivityNavBar />
        <FooterWall />
      </div>
    );
  }
}




export default App;
